import React from 'react';
import styled from 'styled-components'

const Button = styled.button`
height:200px;
width: 200px;
margin: 0 auto;
`

function Cta() {
    return (
        <div>
            <Button>KLIKNI ME</Button>
        </div>
    );
}

export default Cta;
